import './App.css';
import Card from "./Card";
import Navbar from "./Navbar";
import {useState} from "react";


function App() {
    const [products, setProducts] = useState([
        {
            id: "0",
            title: "Car1",
            photo: "data:image/jpeg;base64,"
        },
        {
            id: "1",
            title: "Car2",
            photo: "data:image/jpeg;base64,"
        },

        {
            id: "2",
            title: "Car4",
            photo: "data:image/jpeg;base64,"
        },
        {
            id: "3",
            title: "Car5",
            photo: "data:image/jpeg;base64,"
        },
        {
            id: "4",
            title: "Car6",
            photo: "data:image/jpeg;base64,"
        },
        {
            id: "5",
            title: "Car7",
            photo: "data:image/jpeg;base64,"
        },
        {
            id: "6",
            title: "Car8",
            photo: "data:image/jpeg;base64,"
        },
        {
            id: "7",
            title: "Car3",
            photo: "data:image/jpeg;base64,"
        },
    ]);
    const [intitle, setInTitle] = useState("");
    const [inphoto, setInPhoto] = useState("");

    let handleTitleChange = (value) => {
        setInTitle(value);
    };

    let handlePhotoChange = (value) => {
        setInPhoto(value);
    };
    const addCar = () => {
        const newCar = {
            id: products.length.toString(),
            title: intitle,
            photo: inphoto,
        };
        const newProducts = [...products, newCar];
        setProducts(newProducts);
        setInTitle("");
        setInPhoto("");


    };
    const deleteCard = (cardId) => {
        const updatedProducts = products.filter((product) => product.id !== cardId);
        setProducts(updatedProducts);
        console.log("Card deleted");
    };

    const updateCar = (newcardId) => {
        const updatedProducts = products.map((product) => {
            if (product.id === newcardId) {
                return {
                    id: newcardId,
                    title: intitle,
                    photo: inphoto,
                };
            }
            return product;
        });
        setProducts(updatedProducts);
        setInTitle("");
        setInPhoto("");
        handleTitleChange = () => {
            setInTitle("");
        };

        handlePhotoChange = () => {
            setInPhoto("");
        };
    };


    return (
        <div className="App">
            <Navbar
                inputTitleChange={handleTitleChange}
                inputPhotoChange={handlePhotoChange}
                fnAddCar={addCar}
                setInTitle={setInTitle}
                setInPhoto={setInPhoto}
                intitle={intitle}
                inphoto={inphoto}
            />
            <div className="itemsContainer">
                {products.map((product) => (
                    <Card
                        key={product.id}
                        CardIdName={product.id}
                        CardTitle={product.title}
                        CardImageSrc={product.photo}
                        Del={() => deleteCard(product.id)}
                        updateProduct={() => updateCar(product.id)}
                    />
                ))}
            </div>
        </div>
    );
}

export default App;